import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="container">
        <h1>NavBar...</h1>
        <hr />
        <Switch>
          <Route path="/contacto">Esta Es la Pagina de Contacto</Route>
          <Route path="/nosotros"> Esta es la pagina de nosotros</Route>
          <Route path="/">Esta es la pagina de Inicio</Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
